CREATE PROCEDURE dbo.proc_transform_464
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_464
    SET payload = LEFT(payload, 1000) + N'|V4-464|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_464;
END
